  - uid: 409
    components:
    - name: preflight checklist
      type: MetaData
    - pos: 2.0922058,-4.252999
      parent: 1
      type: Transform
    - stampState: paper_stamp-ce
      stampedBy:
      - stampedBorderless: False
        stampedColor: '#C69B17FF'
        stampedName: stamp-component-stamped-name-ce
      - stampedBorderless: False
        stampedColor: '#00BE00FF'
        stampedName: stamp-component-stamped-name-approved
      content: >-
        [head=1]==========================[/head]

        [head=1]Liquidator-class service ship[/head]

        [head=1] [/head]

        [head=1]     PREFLIGHT CHECKLIST[/head]

        [head=1]==========================[/head]


        [head=2]1. Power supply.[/head]

        [head=3]1.1. Battery units.[/head]

        [bullet/][ ] Check if the SMES unit is anchored to the floor.

        [bullet/][ ] Check if the substation unit is anchored to the floor.

        [bullet/][ ] Check if the APC unit's Main Breaker is toggled on.

        [bullet/][ ] Check the APC unit's current Load[bold]*[/bold] (W).

        [head=3]1.2. P.A.C.K.M.A.N. generator unit.[/head]

        [bullet/][ ] Check if the P.A.C.K.M.A.N. generator unit is anchored to the floor.

        [bullet/][ ] Check if the P.A.C.K.M.A.N. generator unit has fuel. For extended flights make sure that you have enough fuel stockpiled to sustain prolonged power generation.

        [bullet/][ ] Check if the P.A.C.K.M.A.N. generator unit is set to HV output.

        [bullet/][ ] Set Target Power for 18-19[bold]**[/bold] [bold]k[/bold]W.

        [bullet/][ ] Start the P.A.C.K.M.A.N. generator unit.


        [head=2]2. Atmospherics.[/head]

        [head=3]2.1. Distribution Loop.[/head]

        [bullet/][ ] Check if the O2 output pump is set to normal pressure.

        [bullet/][ ] Enable the O2 output pump.

        [bullet/][ ] Check if the N2 output pump is set to normal pressure.

        [bullet/][ ] Enable N2 output pump.

        [bullet/][ ] Check if the gas mixer is set to the correct mixing ratio.

        [bullet/][ ] Check if the gas mixer is set to normal pressure.

        [bullet/][ ] Enable gas mixer.

        [bullet/][ ] Check if the distribution pump is set to normal pressure.

        [bullet/][ ] Enable distribution pump.

        [head=3]2.2. Waste Loop.[/head]

        [bullet/][ ] Enable waste loop pump.


        [head=2]3. Other checks.[/head]

        [bullet/][ ] Check if the gyroscope is anchored, powered, and enabled.

        [bullet/][ ] Check if the mini gravity generator is anchored, powered, and enabled.

        [bullet/][ ] Check if the bow blast doors are closed.


        __________________________________________________________________

        [bold]*[/bold] - Liquidator-class service ships are equipped with a single APC unit that can be used to appraise the ship's total power consumption. One can check the ship's total power consumption against the P.A.C.K.M.A.N. generator unit Target Power output: to keep SMES, substation, and APC fully charged, P.A.C.K.M.A.N. generator unit Target Power output should exceed APC's Load. Remember to check APC Load and adjust the generator unit Target Power after connecting new power-consuming machines.

        [bold]**[/bold] - Liquidator-class service ships have higher power demand than standard P.A.C.K.M.A.N. generator unit can provide at optimal settings: recommended Target Power value to avoid blackouts during Gravity Generator charging sequence is 19 kW. Furthermore, while the portable scrubber unit is online, changing the Target Power value to 20 kW might be advisable.

        [bold]Note:[/bold] Without a working generator, fully charged battery units (SMES and substation) in unmodified Liquidator-class service ships can provide power for approximately 10 minutes before discharging.

        [bold]Note:[/bold] Additional generator units can be purchased at the Frontier Station.
      type: Paper
